And they all inspire the ish out of me! Ate too much. Drank more than planned. 🍸 Slept 3 hours and now on a plane ✈️ to Nashville. Do I feel 💯? Nope. Do I regret it? Again, no! 😁 I’ve been at my laptop the last 6 weeks pulling 12-13 hour days and stepping away from work for a few days (okay... not totally, I’ll work a couple hours in the morning 🤪) but feels SO good. I was invited out last night and it was terrible timing, and this mini trip was also inconvenient- but guess what...OH WELL!!! 💁🏻‍♀️I’ll make up for the sleep. The work. The whatever. Life isn’t just a checklist and calendar, it’s also about the time you spend with friends, the nights you stay out too late, travel last minute, miss some sleep, mess up your plans...I’m a bit of a “yes, man” to adventure. Try saying YES more. Opportunities and adventures are NEVER convenient but they make life rewarding and FUN 💯in the future when you want to do something - remember it will likely NOT be convenient. Say YES anyway! And figure it out. When you get in the habit of that, life finds a way to give you more of what you want. 👏🏻👏🏻👏🏻

